import { Login } from './Login.js'
import { Register } from './Register.js'
import { Navbar } from './Navbar.js'

function App() {
  let component
  switch (window.location.pathname) {
    case "/":
      component = <Login />
      break
    case "/login":
      component = <Login />
      break
    case "/register":
      component = <Register />
      break
  }
  return (
    <div>
      <Navbar/>
      {component}
    </div>

  );
}

export default App;
